        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!{% endblock %}

{% block body %}

<form method=\"post\">
\t{% if error %}
\t\t<div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
\t{% endif %}

\t{% if app.user %}
\t\t<div class=\"mb-3\">
\t\t\tYou are logged in as
\t\t\t{{ app.user.username }},
\t\t\t<a href=\"{{ path('app_logout') }}\">Logout</a>
\t\t</div>
\t{% endif %}


\t<h1 class=\"h3 mb-3 font-weight-normal\">Please sign in</h1>
\t<label for=\"inputEmail\">Email</label>
\t<input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" autocomplete=\"email\" required autofocus>
\t<label for=\"inputPassword\">Password</label>
\t<input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" autocomplete=\"current-password\" required>

\t<input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\" {Uncomment this section and add a remember_me option below your firewall to activate remember me functionality. See https://symfony.com/doc/current/security/remember_me.html <div class=\"checkbox mb-3\"> <label> <input type=\"checkbox\" name=\"_remember_me\"> Remember me </label> </div> #} <button class=\"btn btn-lg btn-primary\" type=\"submit\"> sign in </button> </form>

 
{% endblock %}

